import { Component } from "react";
import { Link } from "react-router-dom";


class REAMyListings extends Component{
    constructor(props) {
        super(props);
        this.state = {
            username:"",
        };
    }

    componentDidMount() {
        this.setState({
            username: window.location.href.split('/')[4]
        });
        fetch('api/mylistings')
          .then(response => response.json())
          .then(data => this.setState({ listings: data, filteredListings: data }))
          .catch(error => console.error('Error fetching listings:', error));
    }

    render(){
        const { username } = this.state;
        return(
            <>
            <div>
                <h2>My Listings</h2>
                <Link to={`/reacreatelistingpage/${username}`}><button>Create Listing</button></Link>
                
            </div>
            </>
        )
    }
}

export default REAMyListings;
